Colin Sullivan werkt voor de grote en beruchte gangster Frank Costello en krijgt de taak te infiltreren in het politiekorps van Boston. Tegelijkertijd werkt undercover-agent Billy 
Costigan zich op in de wereld van Costello en probeert diens vertrouwen te winnen. Maar wat zal er gebeuren wanneer Sullivan en Costigan's wegen elkaar kruisen? Wat volgt is 
een gevaarlijk kat-en-muisspel.
